import logo from './logo.svg';
import './App.css';

function App() {
  return (<div>
    <Header />
    <Switch>
      <Route exact path="/">
        <Home />
      </Route>
      <Route path="/products">
        <Products/>
      </Route>
      <Route path="/company">
        <Company />
      </Route>
    </Switch>
  </div>

  );
}

export default App;
